import React from 'react'
import CartProvider from './Contexts/CartContext'
import CatMenu from './Components/CategoryMenu'
import Footer from './Components/Footer'
import Navbar from './Components/Navbar'
import Main from './main'
import SellerDataProvider from './Contexts/SellerContext'
import axios from 'axios'
import { useSellerData } from './Contexts/SellerContext';

function Theme1(props) {
    axios.defaults.baseURL = 'http://localhost:5000'
    const SellerData = useSellerData()
    let Categories = [
        {
            text : "Fashion ",
            link : "#"
        },
        {
            text : "Mobiles and Tablets",
            link : "#"
        },
        {
            text : "Consumer Electronics",
            link : "#"
        },
        {
            text : "Books ",
            link : "#"
        },
        {
            text : "Movie Tickets",
            link : "#"
        },
        {
            text : "Baby Products",
            link : "#"
        },
        {
            text : "Groceries ",
            link : "#"
        },
        {
            text : "Food Takeaway/Delivery",
            link : "#"
        }
    ]
    return (
        <SellerDataProvider>
        <CartProvider>
            {(Object.keys(SellerData).length>0) ? 
            <div className="overflow-hidden"> 
            <Navbar Arr={Categories} />
            <CatMenu Arr={Categories} />
            <div className="m-24">
            <Main Arr={Categories}/>
            </div>
            <Footer Arr={Categories} title="Foot" />
            </div>
            : 
            <Routes>
                <Route exact path="/" element={<E404/>} ></Route>
            </Routes>
            }
        </CartProvider>
        </SellerDataProvider>
    )
}

export default Theme1
